function Vid({ selectedVideo, selectedSubtitle}) {
    return (
    <div className="main_vid">
        <header className="title-playing">Golu</header>
        <div className="play_area me-2">
        <video className="play_area" width="1000" controls>
            <source src={selectedVideo} type="video/mp4" />
            {/* Assuming the subtitle is a file path or URL */}
            {selectedSubtitle && (
            <track
                src={selectedSubtitle}  // Subtitle file path
                label="English"
                kind="subtitles"
                srclang="en"
                default
            />
            )}
            Your browser does not support the video tag.
        </video>
        </div>
    </div>
    );
}

export default Vid;
